import React from 'react';
import "./styles/Footer.css";

const footer = (props) => (

    <div className="footer">
        <ul>
            <li>Impressum</li>
            <li>Kontakt</li>
            <li>Kategorien</li>
        </ul>
        
        
        
    </div>
);

export default footer;
